import { useHistory } from 'react-router-dom'; // Import useHistory
import './homepage.css'

export const HomePage = () => {
  const [action, setAction] = useState("Sign Up");

  // Function to handle button clicks and route to "/LoginSignUp"
  const handleButtonClick = () => {
    history.push('/LoginSignUp');
  };

  return (
    <div>
      <div className="navbar">
        <div className="left">JSM's Chop Shop</div>
        <div className="right">
          {/* Call handleButtonClick on button click */}
          <button onClick={handleButtonClick}>Sign Up</button>
          <button onClick={handleButtonClick}>Login</button>
        </div>
      </div>
      <div className="main-content">
        <h2>Welcome to JSM's Chop Shop</h2>
        <p>Book your appointment now and get the perfect style!</p>
        <button className="book-now">Book Now</button>
      </div>
      <div className="footer">
        <p>&copy; 2024 JSM's Chop Shop. All rights reserved.</p>
      </div>
    </div>
  );
};
